import React, {useState} from 'react';
import './ExpenseForm.css';

const ExpenseForm = (props) => {
    const [enteredExpense, setEnteredExpense] = useState('');
    const [enteredAmount, setEnteredAmount] = useState('');
    const [enteredDate, setEnteredDate] = useState('');

    const expenseChangeHandler = (event) => {
        setEnteredExpense(event.target.value);
    };
    const amountChangeHandler = (event) => {
        setEnteredAmount(event.target.value);
    };
    const dateChangeHandler = (event) => {
        setEnteredDate(event.target.value);
    };

    const submitHandler = (event) => {
        event.preventDefault();
        const expenseData = {
            title: enteredExpense,
            amount:enteredAmount,
            date: new Date(enteredDate)
        };

        props.onSaveExpenseData(expenseData);
        setEnteredExpense("");
        setEnteredAmount("");
        setEnteredDate("");
    };

    let clicked = false;

    if (!clicked) {
        return <button onClick={onClickHandler}>Add New Expense</button>
    }

    const onClickHandler = () => {
        console.log(event);
    }

    let expenseForm = <button onClick={onClickHandler}>Add New Expense</button>

    return (
        expenseForm
    )
}

export default ExpenseForm;
